def get_hash(message):
	
	global mod
	global mod_exp_table

	hash = 0
	m = len(message)
	for i in xrange(1, m+1):
		hash += ((ord(message[i-1]) * mod_exp_table[m-i]) % mod)
		hash = hash % mod
	return hash

